import React, { Component } from 'react';

export class About extends Component {
    render() {
        return (
            <section id="about">
            <div className="row">
              <div className="three columns">
                <img className="profile-pic" src="images/profilepic.jpg" alt="" />
              </div>
              <div className="nine columns main-col">
                             </div> {/* end .main-col */}
            </div>
          </section>
        );
    }
}
